import React from "react";
import { Card } from 'react-bootstrap'
import classes from './ExpenseDetails.module.css'

const ExpenseDetails=  (props)=>{
    let content

    try{
        let errorMessage='Authentication Failed!'
        let data;
        let Details=[]
        const response=  fetch('https://react-http-333ab-default-rtdb.asia-southeast1.firebasedatabase.app/Expenses.json')
        .then(async (response)=>{
            if(response.ok){
            
                data= await response.json()
            }else{
                data = await response.json();
                if (data && data.error && data.error.message) {
                    errorMessage = data.error.message;
                    throw new Error(errorMessage);
                }
            }
        })
        .then((data)=>{
            console.log(data)
            const key=Object.keys(data)
            console.log(key)
            key.forEach((k)=>{
                content=<li>{data[k].category}</li>
                
            })
        }).catch((err)=>{alert(err.message)})
       
        
        
       /* for(let key of data){
        Details.push({description: data[key].description,
            price: data[key].price,
            category: data[key].category}])
        
        }*/
  
    }catch(err){
        alert(err.message)
    }

    
    return(
        <Card className={classes.users}>
        <ul>
            {content}
        </ul>
        </Card>
    )
}

export default ExpenseDetails
